function markers(markers) {

	if (!markers) return;
	let arr = [];

	markers.forEach(item => {
		let string = "markers=";

		if (item.size) {
			string = string + 'size:' + item.size + '|';
		}
		if (item.color) {
			string = string + 'color:' + item.color + '|';
		}
		if (item.label) {
			string = string + 'label:' + iml.upper(item.label) + '|';
		}

		if (item.address) {
			string = string + item.address
		}
		else if (item.lat && item.long) {
			string = string + item.lat + ',' + item.long
		}

		string.substring(0, string.length - 1);
		arr.push(string);
	});

	return iml.join(arr, '&');
}

