function locationResponse(body, param) {

    if(!body) return;

    if(body.geometry && body.geometry.location) {
        body.urlMap = encodeURI("https://maps.google.com/?q=" + body.geometry.location.lat + ',' + body.geometry.location.lng);
    }
    else if (body.location) {
        body.urlMap = encodeURI("https://maps.google.com/?q=" + body.location.lat + ',' + body.location.lng);
    }
    else {
        body.urlMap = encodeURI("https://maps.google.com/?q=" + param.lat + ',' + param.long);
    }    

    return body;

}

