function directionResponse(body, param) {

    if(iml.length(body) > 0) {
        body.forEach(item => {
            if (item.arrival_time) {
                item.arrival_time.value = iml.parseDate(item.arrival_time.value, 'X');
            }
            if (item.departure_time) {
                item.departure_time.value = iml.parseDate(item.departure_time.value, 'X');
            }
            if (item.transit_details && item.transit_details.arrival_time && item.transit_details.departure_time) {
                item.transit_details.arrival_time.value = iml.parseDate(item.transit_details.arrival_time.value, 'X');
                item.transit_details.departure_time.value = iml.parseDate(item.transit_details.departure_time.value, 'X');
            }
            if (item.steps) {
                item.steps.forEach(i => {
                    if (i.transit_details) {
                        i.transit_details.arrival_time.value = iml.parseDate(i.transit_details.arrival_time.value, 'X');
                        i.transit_details.departure_time.value = iml.parseDate(i.transit_details.departure_time.value, 'X');
                    }
                });
            }

            item.urlMap = encodeURI("https://www.google.com/maps/dir/?api=1&origin=" + item.start_address + "&destination=" + item.end_address + "&travelmode=" + param.travelMode);
        });
    }

    return body;
}

